import React from "react";
import tailwindcss from '@tailwindcss/vite'

export default function Nav() {
  return (
    <nav className="flex justify-between items-center px-8 py-4 bg-pink-100">
      <h1 className="text-xl font-bold text-pink-600">LucyNailedIt</h1>
      <ul className="flex gap-6 text-gray-700 font-medium">
        <li><a href="#about">About</a></li>
        <li><a href="#gallery">Gallery</a></li>
        <li><a href="#appointment">Appointment</a></li>
        <li><a href="#contact">Contact</a></li>
      </ul>
      <button className="px-4 py-2 border border-pink-500 text-pink-500 rounded hover:bg-pink-500 hover:text-white transition">
        Sign in
      </button>
    </nav>
  );
}
